import org.apache.commons.io.FileUtils
import java.io.File
import java.net.URL

// Ein AWS-Account ist nicht nötig. Mit USE_SPARK_S3_DATASOURCE=false werden die Daten über http geladen und im /tmp-Verzeichnis zwischengespeichert
val USE_SPARK_S3_DATASOURCE=false
sc.hadoopConfiguration.set("fs.s3n.region","eu-central-1")
sc.hadoopConfiguration.set("fs.s3n.awsAccessKeyId","YOUR-AWS-ACCESS-KEY")
sc.hadoopConfiguration.set("fs.s3n.awsSecretAccessKey", "YOUR-AWS-SECRET-ACCESS-KEY")

def prepareDataUrl(datafile: String):String = {
    if (USE_SPARK_S3_DATASOURCE) {
        return s"s3n://datenanalyse-mit-spark/$datafile"
    } else {
        val localfile = new File(s"/tmp/$datafile")
        if (!localfile.exists)
            FileUtils.copyURLToFile(new URL(s"https://s3.eu-central-1.amazonaws.com/datenanalyse-mit-spark/$datafile"), localfile)
        return localfile.toString
    }
}

val songsPath = prepareDataUrl("songs.csv.gz")
val tripletsPath = prepareDataUrl("triplets.sample.csv.gz")

